  message: "Fixed Issue with LoadImage node when loading PNG files with embedded ICC\
    \ profiles. (#3316)* Fix issue with how PIL loads small PNG files nodes.py\r\r\
    Added flag to prevent ValueError: Decompressed Data Too Large\rwhen loading PNG\
    \ images with large meta data such as large embedded color profiles\r\r* Update\
    \ LoadImage node to fix error when loading PNG's in nodes.py\r\rFixed Value Error:\
    \ Decompressed Data Too Large thrown by PIL when attempting to opening PNG files\
    \ with large embedded ICC colorspaces by setting the follow flag to true when\
    \ loading png images:  ImageFile.LOAD_TRUNCATED_IMAGES = True\r\r* Update node_helpers.py\
    \ to include open_image helper function\r\ropen_image includes try except to catch\
    \ Pillow Value Errors that occur when large ICC profiles are embedded in images.\r\
    \r* Update LoadImage node to use open_image helper function inplace of Image.open\r\
    \ropen_image helper function in node_helpers.py  fixes a Pillow error when attempting\
    \ to open images with large embedded ICC profiles by adding an exception handler\
    \ to load the image with truncated meta data if regular loading is not possible."
