  message: "Improve A1111 metadata parsing (#3216)* A1111 import: Set VAE name\r\r\
    This patch sets the VAE name for the `VAELoader` when present in the png\rmetadata.\r\
    \r* A1111 import: Skip all hashes\r\rWhen importing from A1111 the parsing assumes\
    \ that values of a key will\rnever contain a \":\", which is not correct.\r\r\
    There are 2 cases where we can have \":\" in the value:\r\r- Inside a string.\
    \ E.g.:\r  Lora hashes: \"xl_more_art-full_v1: fe3b4816be83, add-detail-xl: 9c783c8ce46c\"\
    \r\r- When the value is a json dictionary. E.g.:\r  Hashes: {\"vae\": \"63aeecb90f\"\
    , \"embed:negativeXL_D\": \"fff5d51ab6\"}\r\rThis patch changes how we parse the\
    \ metadata to take those 2 cases into\raccount and also skips the following additional\
    \ keys that are present in\rsome Forge images:\r\r- Version\r- VAE hash\r- TI\
    \ hashes\r- Lora hashes\r- Hashes\r\r* A1111 import: Parse Hires steps\r\rThis\
    \ patch parses the `Hires steps` parameter that is part of the High\rResolution\
    \ Upscale configuration when it  is present, and fallbacks to\rthe one from the\
    \ `samplerNode` (like the code currently does) if it's\rnot present."
