  message: "improve: lightweight preview to reduce network traffic (#733)* To reduce\
    \ bandwidth traffic in a remote environment, a lossy compression-based preview\
    \ mode is provided for displaying simple visualizations in node-based widgets.\r\
    \r* Added 'preview=[image format]' option to the '/view' API.\r* Updated node\
    \ to use preview for displaying images as widgets.\r* Excluded preview usage in\
    \ the open image, save image, mask editor where the original data is required.\r\
    \r* Made preview_format parameterizable for extensibility.\r\r* default preview\
    \ format changed: jpeg -> webp\r\r* Support advanced preview_format option.\r\
    - grayscale option for visual debugging\r- quality option for aggressive reducing\r\
    \rL?;format;quality?\r\rex)\rjpeg => rgb, jpeg, quality 90\rL;webp;80 => grayscale,\
    \ webp, quality 80\rL;png => grayscale, png, quality 90\rwebp;50 => rgb, webp,\
    \ quality 50\r\r* move comment\r\r* * add settings for preview_format\r* default\
    \ value is ''(= don't reencode)\r\r---------\r\rCo-authored-by: Lt.Dr.Data <lt.dr.data@gmail.com>"
